package com.pifirm.persistence;

import com.pifirm.domain.repository.ServicioRepository;
import com.pifirm.persistence.crud.CrudServicio;
import com.pifirm.persistence.entity.ServicioEntity;
import org.springframework.data.domain.Page;
import org.springframework.data.domain.Pageable;
import org.springframework.stereotype.Repository;

import java.util.Optional;

@Repository
public class ServicioEntityRepository implements ServicioRepository {

    private final CrudServicio crudServicio;

    public ServicioEntityRepository(CrudServicio crudServicio) {
        this.crudServicio = crudServicio;
    }

    @Override
    public ServicioEntity save(ServicioEntity servicioEntity) {
        return this.crudServicio.save(servicioEntity);
    }

    @Override
    public Optional<ServicioEntity> findById(Long id) {
        return this.crudServicio.findById(id);
    }

    @Override
    public ServicioEntity update(ServicioEntity servicioEntity) {
        return this.crudServicio.save(servicioEntity);
    }

    @Override
    public void deleteById(Long id) {
        this.crudServicio.deleteById(id);
    }

    @Override
    public Page<ServicioEntity> findAll(Pageable pageable) {
        return this.crudServicio.findAll(pageable);
    }
}

